const countAmountSound =
  "data:audio/mpeg;base64,";

const pushMessage =
  "data:audio/mpeg;base64,";

const bigWin =
  "data:audio/mpeg;base64,";

const binDrop =
  "data:audio/mpeg;base64,";

const pushApp =
  "data:audio/mpeg;base64,";

function playCountSound() {
  playBase64Audio(countAmountSound);
}
function playPushMessageSound() {
  playBase64Audio(pushMessage);
}

function playPushAppSound() {
  playBase64Audio(pushApp);
}

function playBigWinSound() {
  playBase64Audio(bigWin);
}

function playBinDropSound() {
  playBase64Audio(binDrop);
}

function playBase64Audio(base64String) {
  try {
    const audio = new Audio(base64String);
    audio.play().catch((error) => {
      console.error(" :", error);
    });
  } catch (error) {
    console.error("  :", error);
  }
}

export {
  playBigWinSound,
  playCountSound,
  playPushAppSound,
  playPushMessageSound,
  playBinDropSound,
};
